CLI.Usage=Jenkins CLI\n\ 
  Usage: Java-jar jenkins cli.jar [-s URL] command [opts...] args...\nOptions\u00a0:\nURL -s\u00a0: l\u2019URL du serveur (par d\u00e9faut le var JENKINS_URL env)\ni - KEY\u00a0: SSH fichier de cl\u00e9 priv\u00e9e utilis\u00e9e pour l\u2019authentification\n-p\u00a0: PORT d\u2019h\u00f4te\u00a0: h\u00f4te proxy HTTP et le port de la tunnelisation proxy HTTPS. Reportez-vous \u00e0 la section http://jenkins-ci.org/https-proxy-tunnel\n-noCertificateCheck\u00a0: ignore enti\u00e8rement v\u00e9rification du certificat HTTPS. Utiliser avec pr\u00e9caution\n-noKeyAuth\u00a0: n\u2019essayez pas de charger la cl\u00e9 priv\u00e9e de l\u2019authentification SSH. Entre en conflit avec -i\n\nLes commandes disponibles d\u00e9pendent du serveur. Ex\u00e9cutez la commande 'help' \u00e0\nreportez-vous \u00e0 la liste.
